import { createStore } from 'vuex'

const store = createStore({
  state: {
    dynamicRouter: ""
  },
  getters: {
  },
  mutations: {
    setDynamicRouter(state, dynamicRouter) {
      state.dynamicRouter = dynamicRouter;
    },
    getDynamicRouter(state) {
      return state.dynamicRouter;
    }
  },
  actions: {
  },
  modules: {
  }
})
export default store;
